        this.ElementRight = this.getElementRight(this.filterRailShifts[this.filterRailShifts.length - 1]);
        this.min = 0;
        this.max = 0;
        this.elemntsMargins = 0;
        this.prevTranslation = 0;
        this.animationID = 0;
        this.oserver = null;
    }




